    const styles = {
      border: "solid",
      width: "200px",
    };
    return (
      <div>
        <div style={styles}>hi</div>
        <h1>Hello {this.name}</h1>
        <button>Hover me</button>
      </div>
    );
  }
}

const newclass = new App();

console.log(newclass);

export default App;
